import './linkedin.svg';
import './linkedin(1).svg';
import './github.svg';
import './github(1).svg';
import './twitter.svg';
import './twitter(1).svg';
import './TopIcons.css';


const TopIcons = () => {
  return (
    <section>
        <a href='https://www.linkedin.com/in/md-jahid-hasan-584712243/' target='_blank'>
          <img src='./linkedin.(1)svg' alt='linkedin icon'/>
        </a>
        <a href='https://github.com/hmjahid' target='_blank'>
          <img src='./github(1).svg' alt='github icon'/>
        </a>
        <a href='https://twitter.com/mdjahidhasan919' target='_blank'>
          <img src='./twitter.svg' alt='twitter icon'/>
        </a>
    </section>
  )
}

export default TopIcons;
